import React, { Component } from "react";
import "./AppHeader.css";

class AppHeader extends Component {
    render() {
        return (
            <header>
                <div>
                    <p><span>EXAM</span> SHOP</p>
                </div>
                <AppNav />
                <nav>
                    <ul>
                        <li><a>Shop</a></li>
                        <li><a>Login</a></li>
                        <li><a>Register</a></li>
                    </ul>
                </nav>
            </header>
        );
    }
}

export default AppHeader;
